import React from 'react';
import Videos from '../exports/Videos';

import { motion } from 'framer-motion';

const VideoShow = () => {
  return (
    <motion.div className="videoshow">
      <motion.div
        className="videoshowContainer"
        drag="x"
        dragConstraints={{ right: 0, left: -800 }}
      >
        {Videos.map((Video) => (
          <motion.div className="video">
            <img src={Video} alt="" />
          </motion.div>
        ))}
      </motion.div>
    </motion.div>
  );
};

export default VideoShow;
